maximum_order = 10
MONOMIAL_SET_LENGTH = 220


def condition_add(target, coordinate, power):
    if power != 0:
        target += coordinate
        if power != 1:
            target += str(power)
    return target


mdic = {}
pdic = {}
pos = 0
